import React from 'react';
import CartWidget from './CartWidget';

const Navbar = () => {
    return (
        <nav className="navbar container-page">
            <h1>SporeHills</h1>
            <ul>
                <li>Hongos</li>
                <li>Geneticas</li>
                <li>Bloques</li>
            </ul>
            <CartWidget />
        </nav>
    );
};

export default Navbar;
